const numMatchingSubseq = (s, words) => {
    const buckets = new Map();
    for (const word of words) {
        const c = word[0];
        if (!buckets.has(c)) {
            buckets.set(c, []);
        }
        buckets.get(c).push(word);
    }
    let res = 0;
    for (const c of s) {
        if (!buckets.has(c)) {
            continue;
        }
        const old = buckets.get(c).slice();
        buckets.set(c, []);
        for (const t of old) {
            if (t.length === 1) {
                res++;
            } else {
                const nextChar = t[1];
                if (!buckets.has(nextChar)) {
                    buckets.set(nextChar, []);
                }
                buckets.get(nextChar).push(t.slice(1));
            }
        }
    }
    return res;
